CREATE VIEW `vplacas`  AS SELECT `P`.`id_proyecto` AS `id_proyecto`, `P`.`nProyecto` AS `nProyecto`, `P`.`nOrden` AS `nOrden`, `P`.`comPlacas` AS `comPlacas`, `P`.`estadoProyectoEliminado` AS `estadoProyectoEliminado`, `P`.`comSuperPlaca` AS `comSuperPlaca`, `C`.`nombres` AS `nombres`, `C`.`aPaternoCliente` AS `aPaternoCliente`, `C`.`aMaternoCliente` AS `aMaternoCliente`, `V`.`placa` AS `placa`, `M`.`marca` AS `marca`, `Mo`.`modelo` AS `modelo`, `A`.`anio` AS `anio`, `Co`.`color` AS `color`, `CP`.`linkComPlaca` AS `linkComPlaca`, `CP`.`fecha_creacion` AS `fecha_creacion`, `UP`.`nombres` AS `UPN`, `UP`.`aPaterno` AS `UPP`, `UP`.`aMaterno` AS `UPM`, `CS`.`textSupervision` AS `textSupervision`, `CS`.`fecha_registro` AS `CSF`, `UCS`.`nombres` AS `UCSN`, `UCS`.`aPaterno` AS `UCSP`, `UCS`.`aMaterno` AS `UCSM` FROM ((((((((((`proyectos` `P` join `vehiculos` `V` on(`P`.`id_vehiculo` = `V`.`id_vehiculo`)) join `colores` `Co` on(`V`.`id_color` = `Co`.`id_color`)) join `marcas` `M` on(`V`.`id_marca` = `M`.`id_marca`)) join `modelos` `Mo` on(`V`.`id_modelo` = `Mo`.`id_modelo`)) join `anios` `A` on(`V`.`id_anio` = `A`.`id_anio`)) join `clientes` `C` on(`P`.`id_cliente` = `C`.`id_cliente`)) left join `complacas` `CP` on(`P`.`id_proyecto` = `CP`.`id_proyecto`)) left join `usuarios` `UP` on(`CP`.`id_capC` = `UP`.`id_usuario`)) left join `comsupervision` `CS` on(`P`.`id_proyecto` = `CS`.`id_proyecto`)) left join `usuarios` `UCS` on(`CS`.`id_capC` = `UCS`.`id_usuario`)) ;

