CREATE VIEW `vsupercodid`  AS SELECT `P`.`id_proyecto` AS `id_proyecto`, `P`.`nProyecto` AS `nProyecto`, `P`.`nOrden` AS `nOrden`, `P`.`valorVenta` AS `valorVenta`, `V`.`placa` AS `placa`, `Co`.`color` AS `color`, `M`.`marca` AS `marca`, `Mo`.`modelo` AS `modelo`, `A`.`anio` AS `anio`, `RS`.`valorVentaAlta` AS `valorVentaAlta`, `RC`.`id_regcodidenti` AS `id_regcodidenti`, `S`.`semana` AS `semana`, `SC`.`semanaCobro` AS `semanaCobro`, `D`.`valCobProyBase` AS `valCobProyBase`, `D`.`codIdProyBase` AS `codIdProyBase`, `SU`.`compCodId` AS `compCodId`, `SU`.`folioSupervision` AS `folioSupervision` FROM (((((((((((`proyectos` `P` join `vehiculos` `V` on(`P`.`id_vehiculo` = `V`.`id_vehiculo`)) join `colores` `Co` on(`V`.`id_color` = `Co`.`id_color`)) join `marcas` `M` on(`V`.`id_marca` = `M`.`id_marca`)) join `modelos` `Mo` on(`V`.`id_modelo` = `Mo`.`id_modelo`)) join `anios` `A` on(`V`.`id_anio` = `A`.`id_anio`)) join `registrosolicitud` `RS` on(`P`.`id_proyecto` = `RS`.`id_proyecto`)) join `registrocodidenti` `RC` on(`P`.`id_proyecto` = `RC`.`id_proyecto`)) join `semanascobro` `SC` on(`RC`.`id_semanaCobro` = `SC`.`id_semanaCobro`)) join `semanas` `S` on(`RS`.`id_semana` = `S`.`id_semana`)) join `desglocecodid` `D` on(`P`.`id_proyecto` = `D`.`id_proyecto`)) join `supervisado` `SU` on(`P`.`id_proyecto` = `SU`.`id_proyecto`)) WHERE `P`.`superCodIdentificador` = 1 AND `D`.`borrado` = 0 ;

